import React from 'react';
import './Logo.css';

const Logo = () => {
  return (
    <div className="logo-container">
      <div className="logo-3d">
        <div className="logo-text">
          <span className="text-layer front">EDO</span>
          <span className="text-layer middle">EDO</span>
          <span className="text-layer back">EDO</span>
        </div>
      </div>
      <div className="association-name">
        <div className="name-3d">
          <span className="cultural">Cultural</span>
          <span className="association">Association</span>
          <span className="location">Udine Italy</span>
        </div>
      </div>
    </div>
  );
};

export default Logo;
